(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0ab67c"],{"14ad":function(t,n,d){"use strict";d.r(n);var l=function(){var t=this,n=t.$createElement,d=t._self._c||n;return d("div",[d("markdown-it-vue",{staticClass:"md-body",attrs:{content:t.content}})],1)},r=[],e=d("48cd"),i=d.n(e),o=(d("f417"),'\n# HTML基础\n\t\n## 基本结构\n\t\n```html\n<!DOCTYPE html>\n<html>\n\t<head>\n\t\t<meta charset="utf-8">\n\t\t<title>test</title>\n\t</head>\n\t<body>\n\t\tHello World!\n\t</body>\n</html>\n```\n\n## 专业术语\n\n### 标签\n\nHTML标签是HTML的基本组成,一般由一对<>组成,比如`<p>hello world</p>`对于只有一个<>的标签,我们叫单标签,单标签最后需要加`/`表示结束,比如`<img/>`\n\n### 属性\n\n每一个标签的开头,都可以加属性,比如`<a href=""></a>`,这个href就是属性,每一个元素都有一些自己独有的属性,而script 和style属性则是每个标签都有的.\n\n### 文档\n\nHTML文档从`<html>`开始,在`</html>`结束,这里面包裹的内容就是HTML文档,文档头由`<head>`定义,而文档主体由`<body>`定义.\n\n## 说明\n\n本文不会收录所有的标签以及属性,只会挑选最为常用的和实用的,以便快速查找复习.\n\n# 文档相关标签\n\n## !DOCTYPE\n\n!DOCTYPE是整个HTML最重要的标签,也是必写的标签,它表明了本HTML究竟采用哪一版html语言写的,因为除了HTML5之外还有XHTML,HTML 4.01 Strict,HTML 4.01 Transitional等等.不过现在一般都用的是HTML5.\n\n`<!DOCTYPE>` 声明必须是 HTML 文档的第一行，位于` <html>` 标签之前。之后写上你需要的版本属性\n\n```html\n\x3c!-- 声明HTML5 --\x3e\n<!DOCTYPE html>\n```\n\n\n\n## html\n\n标志文档起点与终点\n\n## meta\n\nmtea可以提供有关页面的元信息,就是说,可以给搜索引擎提供一个简历,以确保被搜索到.\n\n# 基础标签\n\n## p\n\n定义段落\n\n```html\n<p>块级元素的标签</p>\n```\n\n## span\n\n```html\n<span>行内元素的标签</span>\n```\n\n## hr\n\n```html\n<p>\n\thr在换行后加水平线<hr/>就像这样\n</p>\n```\n\n## br\n\n```html\n<p>\n\tbr仅仅表示换行<br>就像这样\n</p>\n```\n\n## 注释\n\n```html\n\x3c!-- 我是注释 --\x3e\n```\n\n\n\n# 链接\n\n## a\n\n```html\n<a href="超链接连接的网址">a标签是一个超链接</a>\n```\n\n## link\n\n一般常用于引用外部样式,或者JavaScript文件.\n\n```html\n<link rel="stylesheet" type="text/css" href="引用的路径" />\n```\n\n# 列表\n\n## ul,li\n\n无序列表\n\n```html\n<ul>\n\t<li>我</li>\n\t<li>是</li>\n\t<li>无序列表</li>\n</ul>\n```\n\n<ul>\n\t<li>我</li>\n\t<li>是</li>\n\t<li>无序列表</li>\n</ul>\n\n## ol,li\n\n顺序列表\n\n```html\n<ol>\n\t<li>我</li>\n\t<li>是</li>\n\t<li>有序列表</li>\n</ol>\n```\n<ol>\n\t<li>我</li>\n\t<li>是</li>\n\t<li>有序列表</li>\n</ol>\n\n| 属性     | 值       | 描述                                                         |\n| -------- | -------- | --------------------------------- |\n| reversed | reversed | 规定列表顺序为降序。(9,8,7...) |\n| start    | 数字 | 规定有序列表的起始值。 |\n| type     |1 A a I i  | 规定在列表中使用的标记类型。    |\n\n## dl,dt,dd\n\n```html\n<dl>\n\t<dt>定义列表</dt>\n\t<dd>是专门写定义的列表,如下</dd>\n\t<dt>定义:</dt>\n\t<dd>我是内容</dd>\n</dl>\n```\n\n<dl>\n\t<dt>定义列表</dt>\n\t<dd>是专门写定义的列表,如下</dd>\n\t<dt>定义:</dt>\n\t<dd>我是内容</dd>\n</dl>\n\n# 表单\n\n## form\n\n```html\n<form action="/demo/demo_form.asp">\n\tform表示一个表单，里面本身啥都没有，但是可以放各种表单的标签\n\t<br>\n\t我是一个input：\n\t<input type="text" name="firstname" value="我是一个text input">\n\t<br>\n\t<button type="button">我是一个button</button>\n</form> \n```\n\n\n\n## fieldset,legend\n\n```html\n<form>\n\t<fieldset>\n\t<legend>我是legend，我是这个表单的边框信息</legend>\n\t周围这一圈框框就是fieldset控制的\n\t<br>\n\t输入框：<input type="text" />\n\t</fieldset>\n</form>\n```\n\n## button\n\n```html\n<button type="button">button就是一个按钮</button>\n```\n\n## select,optgroup,option \n\nselect定义选择列表（下拉列表）,option就是里面的选项，optgroup则是选项的分组\n\n```html\n<select>\n\t<optgroup label="我是optgroup,我是第一组选项">\n\t<option value ="被送去服务器的值">option1</option>\n\t<option>选项2</option>\n\t</optgroup>\n\t<optgroup label="我也是optgroup,我是第二组选项">\n\t<option>option3</option>\n\t<option>选项4</option>\n\t</optgroup>\n</select>\n```\n\n<select>\n\t<optgroup label="我是optgroup,我是第一组选项">\n\t<option value ="被送去服务器的值">option1</option>\n\t<option>选项2</option>\n\t</optgroup>\n\t<optgroup label="我也是optgroup,我是第二组选项">\n\t<option>option3</option>\n\t<option>选项4</option>\n\t</optgroup>\n</select>\n\n# 表格\n\n## table,td,tr,th\n\ntable用于定义表格,tr表示这是一行,td表示是一个元素.有几个tr就有几行,一个tr里面几个td就代表这行有几列.\n\n要注意的是,第一行一般都是表格的头,所以用th修饰\n\n```html\n<table>\n\t<tr>\n\t\t<th>th表示表格头</td>\n\t\t<th>我也是表头</td>\n\t\t<th>我也是</td>\n\t</tr>\n\t<tr>\n\t\t<td>table表示一个表格，里面虽然啥都没有，但是可以放表格标签</td>\n\t\t<td>一个tr就用来表示一行表格</td>\n\t\t<td>td就表示每个单元格</td>\n\t</tr>\n\t<tr>\n\t\t<td>我是第2个tr，表示第二行</td>\n\t</tr>\n</table>\n```\n\n<table>\n\t<tr>\n\t\t<th>th表示表格头</td>\n\t\t<th>我也是表头</td>\n\t\t<th>我也是</td>\n\t</tr>\n\t<tr>\n\t\t<td>table表示一个表格，里面虽然啥都没有，但是可以放表格标签</td>\n\t\t<td>一个tr就用来表示一行表格</td>\n\t\t<td>td就表示每个单元格</td>\n\t</tr>\n\t<tr>\n\t\t<td>我是第2个tr，表示第二行</td>\n\t</tr>\n</table>\n**注意:!!!!!!表格默认是没有边框的,这个之所以有,是因为typora自动给我加了样式.**\n\ntable的属性:\n\n<table>\n\t<tbody>\n\t\t<tr>\n\t\t\t<th style="width:20%;">属性</th>\n\t\t\t<th style="width:20%;">值</th>\n\t\t\t<th style="width:60%;">描述</th>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>border</td>\n\t\t\t<td><i>pixels</i></td>\n\t\t\t<td>规定表格边框的宽度。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>cellpadding</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><i>pixels</i></li>\n\t\t\t\t\t<li><i>%</i></li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>就是表格文字和格子边框的距离</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>cellspacing</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><i>pixels</i></li>\n\t\t\t\t\t<li><i>%</i></li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>每个单元格之间的距离</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>frame</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li>void</li>\n\t\t\t\t\t<li>above</li>\n\t\t\t\t\t<li>below</li>\n\t\t\t\t\t<li>hsides</li>\n\t\t\t\t\t<li>lhs</li>\n\t\t\t\t\t<li>rhs</li>\n\t\t\t\t\t<li>vsides</li>\n\t\t\t\t\t<li>box</li>\n\t\t\t\t\t<li>border</li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>规定外侧边框的哪个部分是可见的。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>rules</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li>none</li>\n\t\t\t\t\t<li>groups</li>\n\t\t\t\t\t<li>rows</li>\n\t\t\t\t\t<li>cols</li>\n\t\t\t\t\t<li>all</li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>规定内侧边框的哪个部分是可见的。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>width</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><i>%</i></li>\n\t\t\t\t\t<li><i>pixels</i></li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>规定表格的宽度。</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n\ntd,th的属性\n\n<table>\n\t<tbody>\n\t\t<tr>\n\t\t\t<th style="width:20%;">属性</th>\n\t\t\t<th style="width:20%;">值</th>\n\t\t\t<th style="width:60%;">描述</th>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>align</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li>left</li>\n\t\t\t\t\t<li>right</li>\n\t\t\t\t\t<li>center</li>\n\t\t\t\t\t<li>justify</li>\n\t\t\t\t\t<li>char</li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>规定单元格内容的水平对齐方式。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>axis</td>\n\t\t\t<td><i>category_name</i></td>\n\t\t\t<td>对单元格进行分类。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>char</td>\n\t\t\t<td><i>character</i></td>\n\t\t\t<td>规定根据哪个字符来进行内容的对齐。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>charoff</td>\n\t\t\t<td><i>number</i></td>\n\t\t\t<td>规定对齐字符的偏移量。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>colspan</td>\n\t\t\t<td><i>number</i></td>\n\t\t\t<td>设置单元格可横跨的列数。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>headers</td>\n\t\t\t<td><i>idrefs</i></td>\n\t\t\t<td>由空格分隔的表头单元格 ID 列表，为数据单元格提供表头信息。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>rowspan</td>\n\t\t\t<td><i>number</i></td>\n\t\t\t<td>规定单元格可横跨的行数。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>scope</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li>col</li>\n\t\t\t\t\t<li>colgroup</li>\n\t\t\t\t\t<li>row</li>\n\t\t\t\t\t<li>rowgroup</li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>定义将表头数据与单元数据相关联的方法。</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>valign</td>\n\t\t\t<td>\n\t\t\t\t<ul>\n\t\t\t\t\t<li>top</li>\n\t\t\t\t\t<li>middle</li>\n\t\t\t\t\t<li>bottom</li>\n\t\t\t\t\t<li>baseline</li>\n\t\t\t\t</ul>\n\t\t\t</td>\n\t\t\t<td>规定单元格内容的垂直排列方式。</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n## thead,tbody,tfoot\n\n刚才那个表格其实不是完整版的,虽然也能用.但是实际开发中,能多严谨就要多严谨.\n\n- thead用于表示表头\n- tbody表示表格主题内容\n- tfoot用于总结表的内容,当然你也随便写点啥\n- **注意:这三个的顺序是thead,tfoot,tbody**\n\n```html\n<table>\n\t<thead>\n\t\t<tr>\n\t\t\t<th>妹子</th>\n\t\t\t<th>特征</th>\n\t\t</tr>\n\t</thead>\n\t<tfoot>\n\t\t<tr>\n\t\t\t<th>总体评价</th>\n\t\t\t<th>都是我老婆</th>\n\t\t</tr>\n\t</tfoot>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>牛顿</td>\n\t\t\t<td>金毛双马尾</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>哈雷</td>\n\t\t\t<td>大胸软萌</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>拉瓦锡</td>\n\t\t\t<td>腹黑</td>\n\t\t</tr>\n\t</tbody>\n</table>\n```\n\n\n\n<table>\n\t<thead>\n\t\t<tr>\n\t\t\t<th>妹子</th>\n\t\t\t<th>特征</th>\n\t\t</tr>\n\t</thead>\n\t<tfoot>\n\t\t<tr>\n\t\t\t<th>总体评价</th>\n\t\t\t<th>都是我老婆</th>\n\t\t</tr>\n\t</tfoot>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>牛顿</td>\n\t\t\t<td>金毛双马尾</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>哈雷</td>\n\t\t\t<td>大胸软萌</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>拉瓦锡</td>\n\t\t\t<td>腹黑</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n## caption\n\n表示表格的标题\n\n```html\n<table>\n\t<caption>牛顿与苹果树鉴赏表</caption>\n\t<thead>\n\t\t<tr>\n\t\t\t<th>妹子</th>\n\t\t\t<th>特征</th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>牛顿</td>\n\t\t\t<td>金毛双马尾</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>哈雷</td>\n\t\t\t<td>大胸软萌</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>拉瓦锡</td>\n\t\t\t<td>腹黑</td>\n\t\t</tr>\n\t</tbody>\n</table>\n```\n\n<table>\n\t<caption>牛顿与苹果树鉴赏表</caption>\n\t<thead>\n\t\t<tr>\n\t\t\t<th>妹子</th>\n\t\t\t<th>特征</th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>牛顿</td>\n\t\t\t<td>金毛双马尾</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>哈雷</td>\n\t\t\t<td>大胸软萌</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>拉瓦锡</td>\n\t\t\t<td>腹黑</td>\n\t\t</tr>\n\t</tbody>\n</table>\n\n\n\n# 文本\n\n## abbr\n\n用于定义缩写,并且鼠标滞留时还可以有提示\n\n```html\n镜5莲华下海了,<abbr title="爷的青春结束了">爷青结</abbr>.\n```\n\n镜5莲华下海了,<abbr title="爷的青春结束了">爷青结</abbr>.\n\n\n\n## blockquote\n\n```html\nblockquote是一个长引用，\n<blockquote>\n\t它里面的内容会根据编译器自动排版，表示一个段落的引用\n</blockquote>\n```\n\nblockquote是一个长引用，\n<blockquote>\n\t它里面的内容会根据编译器自动排版，表示一个段落的引用\n</blockquote>\n\n## cite\n\n```html\n<cite>cite语义表示引用，可以表示书名，电影什么的，表现为斜体</cite>\n```\n\n<cite>cite语义表示引用，可以表示书名，电影什么的，表现为斜体</cite>\n\n## ruby，rt，rb\n\n```html\nruby用来表示\n<ruby>注<rt>zhù</rt></ruby>\n<ruby>音<rt>yīn</rt></ruby>。\nruby里面表示要注音的内容，rt里面表示拼音<br>\n若浏览器不支持，就需要用rp了，<br>\nrp标签在 ruby 注释中使用，以定义不支持 ruby 元素的浏览器所显示的内容。<br>\n我是<ruby>注音<rt><rp>(</rp>zhù yīn<rp>)</rp></rt></ruby>\n```\n\nruby用来表示<ruby>注<rt>zhù</rt></ruby><ruby>音<rt>yīn</rt></ruby>。\n\t\truby里面表示要注音的内容，rt里面表示拼音,若浏览器不支持，就需要用rp了，rp标签在 ruby 注释中使用，以定义不支持 ruby 元素的浏览器所显示的内容。\n\t\t我是<ruby>注音<rt><rp>(</rp>zhù yīn<rp>)</rp></rt></ruby>.\n\n## ins\n\n```html\n<ins>这个表示下划线，填空题经常会看到</ins>\n```\n\n<ins>这个表示下划线，填空题经常会看到</ins>\n\n## del\n\n```html\n<del>del里面的内容会被加入删除线，语义上就是删掉的内容</del>\n```\n\n<del>del里面的内容会被加入删除线，语义上就是删掉的内容</del>\n\n## em\n\n```html\n<em>em语义上表示强调语气，表现为斜体</em>\n```\n\n<em>em语义上表示强调语气，表现为斜体</em>\n\n## pre\n\n```html\n<pre>\npre 元素可定义预格式化的文本。被包围在 pre 元素中的文本通常会保留空格和换行符。而文本也会呈现为等宽字体。\n说白了就是，pre里面怎么写，浏览器就怎么显示，因为一般浏览器会忽略多个回车和空格\nint main()\n{\n\treturn 0;\n}\n但是注意标签不能放进去,有的不会显示\n</pre>\n```\n\n<pre>\npre 元素可定义预格式化的文本。被包围在 pre 元素中的文本通常会保留空格和换行符。而文本也会呈现为等宽字体。\n说白了就是，pre里面怎么写，浏览器就怎么显示，因为一般浏览器会忽略多个回车和空格\nint main()\n{\n\treturn 0;\n}\n但是注意标签不能放进去,有的不会显示\n</pre>\n\n## q\n\n```html\n<q>q标签表示短引用，一般语义上表示说话之类的，表现为在标签里面的内容，自动被加了双引号 </q>\n<p>比如说，子曰:<q>知之为知之。</q></p>\n<p>这个引号并不是HTML加的，所以鼠标也不能选中</p>\n```\n\n<q>q标签表示短引用，一般语义上表示说话之类的，表现为在标签里面的内容，自动被加了双引号 </q>\n\n<p>比如说，子曰:<q>知之为知之。</q></p>\n<p>这个引号并不是HTML加的，所以鼠标也不能选中</p>\n\n## strong\n\n```html\n<strong>strong表示强烈强调，语气上非常激动，表现为黑体</strong>\n```\n\n<strong>strong表示强烈强调，语气上非常激动，表现为黑体</strong>\n\n## sub\n\n```html\nsub表示 <sub>下标</sub>，经常用于x<sub>1</sub>之类的数学符号\n```\n\nsub表示 <sub>下标</sub>，经常用于x<sub>1</sub>之类的数学符号\n\n## sup\n\n```html\nsup可以用来表示 <sup>上标</sup>,最常见就是y=x<sup>2</sup>\n```\n\nsup可以用来表示 <sup>上标</sup>,最常见就是y=x<sup>2</sup>\n\n\n\n# HTML的全局属性\n\n就是说所有html元素都具有这些属性,可以随便用.\n\n| 属性            | 描述                                                   |\n| --------------- | ------------------------------------------------------ |\n| accesskey       | 规定激活元素的快捷键。                                 |\n| class           | 规定元素的一个或多个类名（引用样式表中的类）。         |\n| contenteditable | 规定元素内容是否可编辑。                               |\n| contextmenu     | 规定元素的上下文菜单。上下文菜单在用户点击元素时显示。 |\n| data-*        | 用于存储页面或应用程序的私有定制数据。                 |\n| dir             | 规定元素中内容的文本方向。                             |\n| draggable       | 规定元素是否可拖动。                                   |\n| dropzone        | 规定在拖动被拖动数据时是否进行复制、移动或链接。       |\n| hidden          | 规定元素仍未或不再相关。                               |\n| id              | 规定元素的唯一 id。                                    |\n| lang            | 规定元素内容的语言。                                   |\n| spellcheck      | 规定是否对元素进行拼写和语法检查。                     |\n| style           | 规定元素的行内 CSS 样式。                              |\n| tabindex        | 规定元素的 tab 键次序。                                |\n| title           | 规定有关元素的额外信息。                               |\n| translate       | 规定是否应该翻译元素内容。                             |\n\t'),p={components:{MarkdownItVue:i.a},data:function(){return{content:o}}},h=p,b=d("2877"),u=Object(b["a"])(h,l,r,!1,null,null,null);n["default"]=u.exports}}]);
